import React from "react";
const Slotm = (props) => {
  // let x = props.x;
  // let y = props.y;
  // let z = props.z;

  let {x,y,z}={props}
  if (x === y && y === z) {
    return (
      <>
        this is matching
        <h1>
          {x}
          {y}
          {z}
        </h1>
      </>
    );
  } else {
    return (
      <>
        this is not matching
        <h1>
          {x}
          {y}
          {z}
        </h1>
      </>
    );
  }
};

function App() {
  return (
    <>
      <h1 style={{ textAlign: "center" }}>slot machine</h1>
      <Slotm x='a' y='b' z='c' />
      <Slotm x='a' y='a' z='a'/>
      <Slotm x='a' y='v' z='c'/>
    </>
  );
}

export default App;
